import React from 'react';

const Register = ({ history }) => {
    const handleHome = () => {
        // Redirect to login page
        history.push('/login');
      };
  return (
    <div>
      <h1>Welcome to the Home Page!</h1>
      <button onClick={handleHome}>Logout</button>

    </div>
  );
};

export default Home;
